import React from 'react';

const Banner = () => {
  return (
    <div
      style={{
        width: '1440px',
        height: '500px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        overflow: 'hidden',
        margin: '0 auto',
        background: 'linear-gradient(90deg, #F23D31 0%, #D23429 100%)',
        position: 'relative',
      }}
    >
      {/* Sparkle/overlay elements can be added here later */}
    </div>
  );
};

export default Banner;
